function PreloadContainer(a){this.toPreload=[];this.parent=a;this.container}PreloadContainer.prototype.create=function(){this.container=$("<div></div>").appendTo("body").css({display:"none",width:0,height:0,overflow:"hidden"});this.processQueue()};PreloadContainer.prototype.processQueue=function(){for(var a=0;this.toPreload.length>a;a++){if(!this.parent.destroyed){this.preloadImage(this.toPreload[a])}}};PreloadContainer.prototype.addImage=function(a){console.log("Add to queue: "+a);this.toPreload.push(a)};PreloadContainer.prototype.preloadImage=function(a){console.log("Add image to preload container");var b=new PreloadImage();b.addToPreloader(this,a);b.bindLoadEvent()};